0201cf4b-94dc-41a8-97b4-338a3de80c8d	Banane Plantain	La banane plantain est une espèce hybride de plante de la famille des Musaceae. Comme la banane dessert, elle est un sous-groupe de l'espèce Musa àparadisiaca (issue du croisement entre Musa acuminata et Musa balbisiana).\n\nLa banane plantain est simplement appelàe à plantain à en Afrique. Ce fruit, consommà comme un fàculent, prend encore divers noms selon le lieu gàographique : à banane cochon à dans certaines ràgions, à banane farine à ou à banane jaune à dans les Antilles, à banane poingo à en Nouvelle-Calàdonie, ou encore à banane à cuire à1,2,3,4,5.\n\nCette banane est plus riche en amidon que celles habituellement consommàes en dessert. Elle est couramment consommàe dans une grande partie de là?Afrique, dans les Caraàbes, en Amàrique centrale et dans certains pays dà?Amàrique du Sud.\n\nLa banane plantain possàde la caractàristique d'àtre plus rigide que la banane jaune.	/images/0201cf4b-94dc-41a8-97b4-338a3de80c8d.png	Légumes	2025-08-03 20:28:37.396	2025-08-06 15:16:00.825	f	0	d9d96647-5b98-463b-a740-b9073755501f	1
