0201cf4b-94dc-41a8-97b4-338a3de80c8d	Banane Plantain	La banane plantain est une espèce hybride de plante de la famille des Musaceae. Comme la banane dessert, elle est un sous-groupe de l'espèce Musa ×paradisiaca (issue du croisement entre Musa acuminata et Musa balbisiana).\n\nLa banane plantain est simplement appelée « plantain » en Afrique. Ce fruit, consommé comme un féculent, prend encore divers noms selon le lieu géographique : « banane cochon » dans certaines régions, « banane farine » ou « banane jaune » dans les Antilles, « banane poingo » en Nouvelle-Calédonie, ou encore « banane à cuire »1,2,3,4,5.\n\nCette banane est plus riche en amidon que celles habituellement consommées en dessert. Elle est couramment consommée dans une grande partie de l’Afrique, dans les Caraïbes, en Amérique centrale et dans certains pays d’Amérique du Sud.\n\nLa banane plantain possède la caractéristique d'être plus rigide que la banane jaune.	https://catalog-images-live.s3.amazonaws.com/c666d1b105b3d13c9e6f71441f06a264/ccfea6cc-d23c-474f-8ae3-0667106ccadb.jpeg	Légumes	2025-09-02 00:52:24.462	2025-09-18 10:32:22.158	f	0	8a07d8be-fbd0-4819-a95e-a1105792128c	1
