a spiruline est un complément alimentaire populaire pour ceux qui cherchent à améliorer leur bien-être global.\\",\\"variants\\":[{\\"id\\":\\"F4DFA1A0-49A7-464A-9E2F-FABFF13A658C\\",\\"optionSet\\":\\"Poids\\",\\"optionValue\\":\\"90g\\",\\"productId\\":\\"\\",\\"description\\":\\"\\",\\"imageUrl\\":\\"/images/.png\\",\\"price\\":24.3,\\"stock\\":9}],\\"globalStock\\":0,\\"baseQuantity\\":1},{\\"id\\":\\"F7BB1555-9C1D-49F4-9170-A5E430F92155\\",\\"category\\":\\"Produits de la mer\\",\\"name\\":\\"Steak de marlin\\",\\"imageUrl\\":\\"/images/F7BB1555-9C1D-49F4-9170-A5E430F92155.png\\",\\"showInStore\\":true,\\"description\\":\\"<p>Pour changer du classique steak de thon, laissez-vous tenter par le délicieux steak de marlin frais Le Pêcheur Créole. Avec sa chair légèrement rosée et sa texture fondante, il séduit les amateurs de poisson grillé et de poisson cru. L’absence de peau se révèle, quant à elle, très pratique en cuisine.</p>\\",\\"variants\\":[{\\"id\\":\\"A0EA0E8D-CAE9-4FA4-BA21-52838DDA6E8E\\",\\"optionSet\\":\\"Poids\\",\\"optionValue\\":\\"500 g\\",\\"productId\\":\\"\\",\\"description\\":\\"\\",\\"imageUrl\\":\\"/images/.png\\",\\"price\\":14.1,\\"stock\\":0},{\\"id\\":\\"5AE6EDB5-2082-407E-A709-4E216404065B\\",\\"optionSet\\":\\"Poids\\",\\"optionValue\\":\\"200 g\\",\\"productId\\":\\"\\",\\"description\\":\\"\\",\\"imageUrl\\":\\"/images/.png\\",\\"price\\":6.5,\\"stock\\":0}],\\"globalStock\\":0,\\"baseQuantity\\":1},{\\"id\\":\\"2FEEEFA8-61B4-4DD0-B939-41C3BC7D9D6F\\",\\"category\\":\\"Produits de la mer\\",\\"name\\":\\"Steak de thon\\",\\"imageUrl\\":\\"/images/2FEEEFA8-61B4-4DD0-B939-41C3BC7D9D6F.png\\",\\"showInStore\\":true,\\"description\\":\\"Découvrez notre délicieux steak de thon frais pêché directement dans les eaux cristallines de la Martinique. Sélectionné avec soin pour sa qualité exceptionnelle, ce thon est mis sous vide immédiatement après la pêche pour préserver toute sa fraîcheur et ses saveurs. Le processus de congélation garantit 