g\\",\\"price\\":2.5,\\"stock\\":0}]},{\\"id\\":\\"1e4eef25-6c86-43b7-9ae4-14f8e1b4fe50\\",\\"category\\":\\"Ta Nou Bio\\",\\"name\\":\\"Avocat bio\\",\\"imageUrl\\":\\"/images/1e4eef25-6c86-43b7-9ae4-14f8e1b4fe50.png\\",\\"showInStore\\":false,\\"description\\":\\"\\",\\"variants\\":[{\\"id\\":\\"13bafdf4-1007-4780-95b8-6ed7c8929aa7\\",\\"optionSet\\":\\"\\",\\"optionValue\\":\\"\\",\\"productId\\":\\"1e4eef25-6c86-43b7-9ae4-14f8e1b4fe50\\",\\"description\\":\\"\\",\\"imageUrl\\":\\"/images/1e4eef25-6c86-43b7-9ae4-14f8e1b4fe50.png\\",\\"price\\":3.5,\\"stock\\":0}]},{\\"id\\":\\"e10e7665-6238-449c-9410-5c817510d0d1\\",\\"category\\":\\"Ta Nou Bio\\",\\"name\\":\\"Banane dessert bio\\",\\"imageUrl\\":\\"/images/e10e7665-6238-449c-9410-5c817510d0d1.png\\",\\"showInStore\\":false,\\"description\\":\\"En plus des bienfaits qu'on lui connaît déjà tel que l'apport de potassium et manganèse, l'amélioration de la santé digestive etc. la banane est également connue pour contenir une acide aminée appelé tryptophane nécessaire pour produire la sérotonine \\\\\\"l'hormone du bonheur\\\\\\". Très utile en cas de petite faim elle est donc aussi un bon moyen de garder la... bananea!\\",\\"variants\\":[{\\"id\\":\\"8c2f70d7-c615-4bd3-86d3-6e4149f5f7c3\\",\\"optionSet\\":\\"Poids\\",\\"optionValue\\":\\"1 Kg\\",\\"productId\\":\\"\\",\\"description\\":\\"\\",\\"imageUrl\\":\\"/images/.png\\",\\"price\\":2.1,\\"stock\\":0}]},{\\"id\\":\\"0d5ea1c1-4684-40c7-b3e2-74abcf530048\\",\\"category\\":\\"Fruits\\",\\"name\\":\\"Banane figue pomme\\",\\"imageUrl\\":\\"/images/0d5ea1c1-4684-40c7-b3e2-74abcf530048.png\\",\\"showInStore\\":false,\\"description\\":\\"\\\\nSi en France, on ne connaît la banane que comme le fruit généralement consommé en dessert, bien sucré et qui s’accompagne très bien avec du chocolat, il n’en est rien dans les îles tropicales et en Afrique. En effet les différentes variétés de bananes peuvent être consommées salées avec des légumes. Récemment, René Redzepi, le chef du restaurant Noma, a découvert une autre espèce de banane, la figue pomme. De taille minuscule, elle a un arrière goût acidulé rappelant la pomme mais une chair bien sucrée. Malgré son goût très apprécié et son caractère unique (10 cm de longueur à peine), le fruit est touché par la maladie de Panama qui risque de le faire disparaître dans les années à venir.\\\\n\\\\nSource : https://www.foodpowa.com/la-figue-pomme-la-mini-banane-au-gout-particulier/\\",\\"variants\\":[{\\"id\\":\\"41976f39-3641-4cbc-92e2-08d296f11270\\",\\"optionSet\\":\\"Poids\\",\\"optionValue\\":\\"500 g\\",\\"productId\\":\\"\\",\\"description\\":\\"\\",\\"imageUrl\\":\\"/images/.png\\",\\"price\\":2,\\"stock\\":0}]},{\\"id\\":\\"0c7ade9e-bb65-4516-bdd9-f05ec6ca6549\\",\\"category\\":\\"Ta Nou Bio\\",\\"name\\":\\"Banane figue pomme bio\\",\\"imageUrl\\":\\"/images/0c7ade9e-bb65-4516-bdd9-f05ec6ca6549.png\\",\\"showInStore\\":true,\\"description\\":\\"\\",\\"variants\\":[{\\"id\\":\\"39d55662-ccf1-40fd-84a4-e9604fb881b9\\",\\"optionSet\\":\\"Poids\\",\\"optionValue\\":\\"0,500 Kg\\",\\"productId\\":\\"\\",\\"description\\":\\"\\",\\"imageUrl\\":\\"/images/.png\\",\\"price\\":1.75,\\"stock\\":0}]},{\\"id\\":\\"c520c6d9-5bff-4b54-bbed-bf67e6909940\\",\\"category\\":\\"Légumes\\",\\"name\\":\\"Banane frécinette\\",\\"imageUrl\\":\\"/images/c520c6d9-5bff-4b54-bbed-bf67e6909940.png\\",\\"showInStore\\":false,\\"description\\":\\"La banane Frécinette est une banane de petite taille. Elle est tout particulièrement savoureuse comme si on avait condensé toutes les qualités d'une banane dans un modèle réduit ! La frécinette est l'encas idéal pour les petits et les grands !\\",\\"variants\\":[{\\"id\\":\\"5cf0b083-6338-40b1-8868-5d5ff41f9cf0\\",\\"optionSet\\":\\"Poids\\",\\"optionValue\\":\\"500 g\\",\\"productId\\":\\"\\",\\"description\\":\\"\\",\\"imageUrl\\":\\"/images/.png\\",\\"price\\":2.2,\\"stock\\":0}]},{\\"id\\":\\"3553fd6b-a2a7-4e0b-bca2-dfe996e2d5b9\\",\\"category\\":\\"Ta Nou Bio\\",\\"name\\":\\"Banane Makandja Bio\\",\\"imageUrl\\":\\"/images/3553fd6b-a2a7-4e0b-bca2-dfe996e2d5b9.png\\",\\"showInStore\\":false,\\"description\\":\\"La banane Makandja est une variété de banane rustique qui représente une belle alternative à la banane dessert Cavendish à laquelle nous sommes tous habitués. La Makandja est plus parfumée et sucrée.<br>L'essayer c'est l'adopter !<br>Attention : dégustez-la dès que sa peau commence à se tâcheter et qu'elle prend une couleur verte jaunâtre. Elle ne deviendra pas toute jaune comme les bananes de supermarché.\\",\\"variants\\":[{\\"id\\":\\"29fddb5a-9672-4ee8-aa7b-ffc0a7c3e83c\\",\\"optionSet\\":\\"Poids\\",\\"optionValue\\":\\"500 g\\",\\"productId\\":\\"\\",\\"description\\":\\"\\",\\"imageUrl\\":\\"/images/.png\\",\\"price\\":2.2,\\"stock\\":0}]},{\\"id\\":\\"0201cf4b-94dc-41a8-97b4-338a3de80c8d\\",\\"category\\":\\"Légumes\\",\\"name\\":\\"Banane Plantain\\",\\"imageUrl\\":\\"/images/0201cf4b-94dc-41a8-97b4-338a3de80c8d.png\\",\\"showInStore\\":false,\\"description\\":\\"La banane plantain est une espèce hybride de plante de la famille des Musaceae. Comme la banane dessert, elle est un sous-groupe de l'espèce Musa ×paradisiaca (issue du croisement entre Musa acuminata et Musa balbisiana).\\\\n\\\\nLa banane plantain est simplement appelée « plantain » en Afrique. Ce fruit, consommé comme un féculent, prend encore divers noms selon le lieu géographique : « banane cochon » dans certaines régions, « banane farine » ou « banane jaune » dans les Antilles, « banane poingo » en Nouvelle-Calédonie, ou encore « banane à cuire »1,2,3,4,5.\\\\n\\\\nCette banane est plus riche en amidon que celles habituellement consommées en dessert. Elle est couramment consommée dans une grande partie de l’Afrique, dans les Caraïbes, en Amérique centrale et dans certains pays d’Amérique du Sud.\\\\n\\\\nLa banane plantain possède la caractéristique d'être plus rigide que la banane jaune.\\",\\"variants\\":[{\\"id\\":\\"af93e7b0-3b8b-4eaf-aea9-ef3ceba9b501\\",\\"optionSet\\":\\"Poids\\",\\"optionValue\\":\\"500 g\\",\\"productId\\":\\"\\",\\"description\\":\\"\\",\\"imageUrl\\":\\"/images/.png\\",\\"price\\":2.2,\\"stock\\":0}]},{\\"id\\":\\"7966393b-3132-4139-b8da-3947f44a1ba3\\",\\"category\\":\\"Ta Nou Bio\\",\\"name\\":\\"Banane plantain bio\\",\\"imageUrl\\":\\"/images/7966393b-3132-4139-b8da-3947f44a1ba3.png\\",\\"showInStore\\":true,\\"description\\":\\"\\",\\"variants\\":[{\\"id\\":\\"33579ee2-5b67-4f90-8cfb-46f37f539679\\",\\"optionSet\\":\\"Poids\\",\\"optionValue\\":\\"500g\\",\\"productId\\":\\"\\",\\"description\\":\\"\\",\\"imageUrl\\":\\"/images/.png\\",\\"price\\":2.5,\\"stock\\":48}]},{\\"id\\":\\"955940b2-c3cc-4279-ae84-366ef5b27f9c\\",\\"category\\":\\"Ta Nou Bio\\",\\"name\\":\\"Bananes mélangées Bio\\",\\"imageUrl\\":\\"/images/955940b2-c3cc-4279-ae84-366ef5b27f9c.png\\",\\"showInStore\\":true,\\"description\\":\\"Conditionnement sous forme de mélange de bananes séchées (tolée, kankanbou, cavendish, plantain, parfois mackanja ou figue pomme) en sachet vendu à l'unité.\\",\\"variants\\":[{\\"id\\":\\"e0cbfa87-0a05-479b-80da-03ef2b884784\\",\\"optionSet\\":\\"\\",\\"optionValue\\":\\"\\",\\"productId\\":\\"955940b2-c3cc-4279-ae84-366ef5b27f9c\\",\\"description\\":\\"Conditionnement sous forme de mélange de bananes séchées (tolée, kankanbou, cavendish, plantain, parfois mackanja ou figue pomme) en sachet vendu à l'unité.\\",\\"imageUrl\\":\\"/images/955940b2-c3cc-4279-ae84-366ef5b27f9c.png\\",\\"price\\":4.6,\\"stock\\":6}]},{\\"id\\":\\"97fb474f-e8ab-4311-ba24-28f1eab7c4b0\\",\\"category\\":\\"Ta Nou Bio\\",\\"name\\":\\"Bananes séchées du nord Bio\\",\\"imageUrl\\":\\"/images/97fb474f-e8ab-4311-ba24-28f1eab7c4b0.png\\",\\"showInStore\\":false,\\"description\\":\\"Conditionnement sous forme de banane séchées en sachet de 70g environ vendu à l'unité.\\",\\"variants\\":[{\\"id\\":\\"28ccc85b-4729-4002-96c1-f57cee856915\\",\\"optionSet\\":\\"\\",\\"optionValue\\":\\"\\",\\"productId\\":\\"9