ioxydantes, aidant à lutter contre l'inflammation et à protéger les cellules du corps. Enfin, des études suggèrent que la spiruline pourrait avoir des effets positifs sur la santé cardiaque, la glycémie et même la perte de poids. En résumé, la spiruline est un complément alimentaire populaire pour ceux qui cherchent à améliorer leur bien-être global.\\",\\"variants\\":[{\\"id\\":\\"F4DFA1A0-49A7-464A-9E2F-FABFF13A658C\\",\\"optionSet\\":\\"Poids\\",\\"optionValue\\":\\"90g\\",\\"productId\\":\\"\\",\\"description\\":\\"\\",\\"imageUrl\\":\\"/images/.png\\",\\"price\\":24.3,\\"stock\\":9}]},{\\"id\\":\\"F7BB1555-9C1D-49F4-9170-A5E430F92155\\",\\"category\\":\\"Produits de la mer\\",\\"name\\":\\"Steak de marlin\\",\\"imageUrl\\":\\"/images/F7BB1555-9C1D-49F4-9170-A5E430F92155.png\\",\\"showInStore\\":true,\\"description\\":\\"<p>Pour changer du classique steak de thon, laissez-vous tenter par le délicieux steak de marlin frais Le Pêcheur Créole. Avec sa chair légèrement rosée et sa texture fondante, il séduit les amateurs de poisson grillé et de poisson cru. L’absence de peau se révèle, quant à elle, très pratique en cuisine.</p>\\",\\"variants\\":[{\\"id\\":\\"A0EA0E8D-CAE9-4FA4-BA21-52838DDA6E8E\\",\\"optionSet\\":\\"Poids\\",\\"optionValue\\":\\"500 g\\",\\"productId\\":\\"\\",\\"description\\":\\"\\",\\"imageUrl\\":\\"/images/.png\\",\\"price\\":14.1,\\"stock\\":0},{\\"id\\":\\"5AE6EDB5-2082-407E-A709-4E216404065B\\",\\"optionSet\\":\\"Poids\\",\\"optionValue\\":\\"200 g\\",\\"productId\\":\\"\\",\\"description\\":\\"\\",\\"imageUrl\\":\\"/images/.png\\",\\"price\\":6.5,\\"stock\\":0}]},{\\"id\\":\\"2FEEEFA8-61B4-4DD0-B939-41C3BC7D9D6F\\",\\"category\\":\\"Produits de la mer\\",\\"name\\":\\"Steak de thon\\",\\"imageUrl\\":\\"/images/2FEEEFA8-61B4-4DD0-B939-41C3BC7D9D6F.png\\",\\"showInStore\\":true,\\"description\\":\\"Découvrez notre délicieux steak de thon frais pêché directement dans les eaux cristallines de la Martinique. Sélectionné avec soin pour sa qualité exceptionnelle, ce thon est mis sous vide immédiatement après la pêche pour préserver toute sa fraîcheur et ses saveurs. Le processus de congélation garantit une conservation optimale sans compromis sur la texture ou le goût. Idéal pour des préparations variées, que ce soit grillé, poêlé ou en tataki, ce steak de thon vous offre une expérience culinaire authentique et savoureuse. Apportez une touche exotique et saine à vos repas avec notre thon frais de Martinique.\\",\\"variants\\":[{\\"id\\":\\"5005471C-1B95-4334-9482-4EB1F64AD287\\",\\"optionSet\\":\\"Poids\\",\\"optionValue\\":\\"0,500 Kg\\",\\"productId\\":\\"\\",\\"description\\":\\"\\",\\"imageUrl\\":\\"/images/.png\\",\\"price\\":13,\\"stock\\":0}]},{\\"id\\":\\"5ecff317-e6ef-4a6d-9e13-2ae28b8608af\\",\\"category\\":\\"Produits transformés\\",\\"name\\":\\"Steak Haché de Poisson \\",\\"imageUrl\\":\\"/images/5ecff317-e6ef-4a6d-9e13-2ae28b8608af.png\\",\\"showInStore\\":true,\\"description\\":\\"Découvrez nos deux steaks haché de poisson frais et succulents 100% chaire de poisson sans arrête et déjà assaisonné , disponibles sous vide pour préserver leur fraîcheur. Chaque steak est préparé à partir des poissons les plus fins de nos eaux locales, garantissant une expérience gustative exceptionnelle à chaque bouchée. Que vous choisissiez de les congeler pour une dégustation ultérieure ou de les savourer immédiatement, nos steaks de poisson locaux sont une véritable invitation à un festin de saveurs océaniques. Commandez dès maintenant pour une expérience culinaire inoubliable !\\",\\"variants\\":[{\\"id\\":\\"3c1a2632-4a5f-44f8-bb46-729da6ca2548\\",\\"optionSet\\":\\"Poids\\",\\"optionValue\\":\\"200 g\\",\\"productId\\":\\"\\",\\"description\\":\\"\\",\\"imageUrl\\":\\"/images/.png\\",\\"price\\":8,\\"stock\\":7}]},{\\"id\\":\\"3b79a27a-a4b3-4fcb-9bc7-b15005e16462\\",\\"category\\":\\"Légumes\\",\\"name\\":\\"Tété dwet\\",\\"imageUrl\\":\\"/images/3b79a27a-a4b3-4fcb-9bc7-b15005e16462.png\\",\\"showInStore\\":